function getRandomColor(){"use strict";for(var t="#",e=0;e<6;e++)t+="0123456789ABCDEF"[Math.floor(16*Math.random())];return t}var ctx=document.getElementById("chart").getContext("2d");$.getJSON("stats.json",function(t){"use strict";var e=[];$.each(t,function(t,a){var o=[],n=getRandomColor();$.each(a,function(t,e){o.push({x:t,y:e})}),e.push({label:t,backgroundColor:n,borderColor:n,data:o,fill:!1})});new Chart(ctx,{type:"line",data:{datasets:e},options:{responsive:!0,scales:{xAxes:[{type:"time",scaleLabel:{display:!0,labelString:"Date"}}],yAxes:[{ticks:{min:0},scaleLabel:{display:!0,labelString:"Request number"}}]}}})});
